import axios from 'axios';

export function getAPOD(date = '') {
  return axios.get(`https://api.nasa.gov/planetary/apod?api_key=8uS9bg7RoejQUX7YpG5SYkA5Ow9CZ7JZ4plXBT3x&date=${date}`);
}
